import axios from "axios";
import { useEffect, useState } from "react";
import { useCookies } from "react-cookie";
import { BrowserRouter as Router, useNavigate } from "react-router-dom";
import { toast } from "react-toastify";

export default function Navbar() {
  const [cookies, setCookie, removeCookie] = useCookies([]);
  const [showImage, setShowImage] = useState(false); // State variable to control image visibility
  const navigate = useNavigate();

  useEffect(() => {
    if (localStorage.getItem("ROLENAME")) {
      document.getElementById("login").innerHTML = "Logout";
    } else {
      document.getElementById("login").innerHTML = "Login";
    }
  }, []);

  const logout = async () => {
    if (localStorage.getItem("ROLENAME")) {
      navigate("/");
      await axios.post("http://localhost:4000/logout");
      removeCookie("jwt"); // Remove the "jwt" cookie
      localStorage.removeItem("ROLENAME");
    } else {
      navigate("/login");
    }
  };

  const handleImageClick = () => {
    setShowImage(!showImage); // Toggle the image visibility
  };

  return (
    <>
      <div>
        <nav className="navbar navbar-expand-lg  btn btn-dark">
          <div className="container-fluid">
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarSupportedContent"
              aria-controls="navbarSupportedContent"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse justify-content-between" id="navbarSupportedContent">
              <ul className="navbar-nav">
                <li className="nav-item">
                  <a href="/">
                    <button className="btn btn-dark">Home</button>
                  </a>
                </li>
              </ul>
              <ul className="navbar-nav">
                <li className="nav item">
                  <button
                    id="login"
                    className="btn btn-primary"
                    onClick={logout}
                  >
                    Logout
                  </button>
                </li>
                <li className="nav-item mx-3">
                  <img
                    src="./Screenshot (313).png"
                    alt="Launch demo"
                    aria-label="exampleModal"
                    onClick={handleImageClick}
                  />
                  {showImage && (
                    <div
                      className="modal fade"
                      id="exampleModal"
                      tabIndex="-1"
                      aria-labelledby="exampleModalLabel"
                      aria-hidden="true"
                    >
                      <div className="modal-dialog">
                        <div className="modal-content">
                          <div className="modal-header">
                            <h1 className="modal-title fs-5" id="exampleModalLabel">
                              Modal title
                            </h1>
                            <button
                              type="button"
                              className="btn-close"
                              data-bs-dismiss="modal"
                              aria-label="Close"
                            ></button>
                          </div>
                          <div className="modal-body">
                           
                           <button><img src="./Screenshot (313).png" alt="Image" /></button> 
                          </div>
                          <div className="modal-footer">
                            <button
                              type="button"
                              className="btn btn-secondary"
                              data-bs-dismiss="modal"
                            >
                              Close
                            </button>
                            <button
                              type="button"
                              className="btn btn-primary"
                            >
                              Save changes
                            </button>
                          </div>
                        </div>
                      </div>
                    </div>
                  )}
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </div>
    </>
  );
}
